import React from 'react'
import FormTmp from '../components/Form_tmp'
import ShowTmp from '../components/Show_tmp'
import useFetch from '../handling/useFetch'

const Create_tmp = () => {

  const {error, isPending, data: list} = useFetch('http://localhost:8080/api/datalog')

  return (
    <div className='create_page'>
      <FormTmp />
      <ShowTmp data={list} />
    </div>
  )
}

export default Create_tmp
